CREATE TABLE IF NOT EXISTS BPout (
    `rows_producer_key` VARCHAR(53) CHARACTER SET utf8,
    `rows_unpaid_blocks` INT,
    `rows_last_claim_time` INT,
    `rows_is_active` INT,
    `rows_owner` VARCHAR(12) CHARACTER SET utf8,
    `rows_url` VARCHAR(45) CHARACTER SET utf8,
    `rows_location` INT,
    `rows_total_votes` NUMERIC(35, 17),
    `total_producer_vote_weight` NUMERIC(37, 17),
    `more` VARCHAR(12) CHARACTER SET utf8
);
